import React, { useEffect, useState } from 'react';
import axios from 'axios';

const OwnerScreen = () => {
  const [codDetails, setCodDetails] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/cod-details/')
      .then(response => {
        setCodDetails(response.data);
        setLoading(false);
      })
      .catch(error => {
        setError('Error fetching data');
        setLoading(false);
      });
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1 style={{ color: '#333' }}>COD Details</h1>
      <table style={{ width: '100%', borderCollapse: 'collapse', margin: '20px 0' }}>
        <thead>
          <tr style={{ backgroundColor: '#black' }}>
            <th style={{ padding: '10px', borderBottom: '2px solid #ddd' }}>Name</th>
            <th style={{ padding: '10px', borderBottom: '2px solid #ddd' }}>Phone</th>
            <th style={{ padding: '10px', borderBottom: '2px solid #ddd' }}>Email</th>
            <th style={{ padding: '10px', borderBottom: '2px solid #ddd' }}>Address</th>
          </tr>
        </thead>
        <tbody>
          {codDetails.map(detail => (
            <tr key={detail.id} style={{ borderBottom: '1px solid #ddd' }}>
              <td style={{ padding: '10px' }}>{detail.name}</td>
              <td style={{ padding: '10px' }}>{detail.phone}</td>
              <td style={{ padding: '10px' }}>{detail.email}</td>
              <td style={{ padding: '10px' }}>{detail.address}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default OwnerScreen;
